import React, { useState, useEffect } from 'react';
import Navbar from '../../components/Common/Navbar';
import LogoutButton from '../../components/Common/LogoutButton';
import UserInfo from '../../components/Common/UserInfo';
import axios from 'axios';

function MapManagementPage() {
  const [maps, setMaps] = useState([]);
  const [selectedMap, setSelectedMap] = useState(null);
  const [name, setName] = useState('');
  const [description, setDescription] = useState('');
  const [mapFile, setMapFile] = useState(null);
  const [yamlFile, setYamlFile] = useState(null);
  const [isMonitored, setIsMonitored] = useState(false);

  useEffect(() => {
    fetchMaps();
  }, []);

  const fetchMaps = async () => {
    const token = localStorage.getItem('token');

    if (!token) {
      alert('No token found, please log in again.');
      return;
    }

    try {
      const response = await axios.get('http://172.30.1.26:5557/map/maps', {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });
      setMaps(response.data);
    } catch (error) {
      console.error('Error fetching maps:', error);
    }
  };

  const handleSelectMap = (map) => {
    setSelectedMap(map);
    setName(map.name);
    setDescription(map.description);
    setIsMonitored(map.isMonitored || false);
  };

  const handleFileChange = (e) => {
    setMapFile(e.target.files[0]);
  };

  const handleYamlFileChange = (e) => {
    setYamlFile(e.target.files[0]);
  };

  const handleUploadOrUpdate = async (e) => {
    e.preventDefault();

    const token = localStorage.getItem('token');

    if (!token) {
      alert('No token found, please log in again.');
      return;
    }

    const formData = new FormData();
    formData.append('name', name);
    formData.append('description', description);
    if (mapFile) formData.append('file', mapFile);
    if (yamlFile) formData.append('yaml', yamlFile);
    formData.append('isMonitored', isMonitored);

    try {
      if (selectedMap) {
        // 맵 수정
        await axios.put(`http://172.30.1.26:5557/map/update/${selectedMap._id}`, {
          name,
          description,
          isMonitored
        }, {
          headers: {
            'Authorization': `Bearer ${token}`,
            'Content-Type': 'application/json'
          }
        });
        alert('Map updated successfully');
      } else {
        // 맵 업로드
        await axios.post('http://172.30.1.26:5557/map/upload', formData, {
          headers: {
            'Authorization': `Bearer ${token}`,
            'Content-Type': 'multipart/form-data'
          }
        });
        alert('Map uploaded successfully');
      }
      resetForm();
      fetchMaps();
    } catch (error) {
      console.error('Error uploading or updating map:', error);
    }
  };

  const resetForm = () => {
    setSelectedMap(null);
    setName('');
    setDescription('');
    setMapFile(null);
    setYamlFile(null);
    setIsMonitored(false);
  };

  return (
    <div style={{ fontFamily: 'Arial, sans-serif', margin: '20px' }}>
      <header style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '20px' }}>
        <UserInfo />
        <LogoutButton />
      </header>
      <Navbar />
      <h2 style={{ textAlign: 'center', margin: '20px 0' }}>Map Management</h2>
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <h3>Your Maps</h3>
        <ul style={{ listStyleType: 'none', padding: 0 }}>
          {maps.map((map) => (
            <li key={map._id} onClick={() => handleSelectMap(map)} style={{ padding: '10px', cursor: 'pointer', borderBottom: '1px solid #ccc' }}>
              {map.name}
            </li>
          ))}
        </ul>

        <form onSubmit={handleUploadOrUpdate} style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <input
            type="text"
            placeholder="Map Name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
            minLength="2"
            style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
          />
          <textarea
            placeholder="Map Description"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            required
            style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
          />
          <label style={{ margin: '10px 0', color: '#333' }}>
            Map File (.pgm, .png, .jpg)
          </label>
          <input
            type="file"
            accept=".pgm,.png,.jpg"
            onChange={handleFileChange}
            style={{ margin: '10px 0' }}
          />
          <label style={{ margin: '10px 0', color: '#333' }}>
            YAML File (.yaml)
          </label>
          <input
            type="file"
            accept=".yaml"
            onChange={handleYamlFileChange}
            style={{ margin: '10px 0' }}
          />
          <label style={{ margin: '10px 0', color: '#333' }}>
            <input
              type="checkbox"
              checked={isMonitored}
              onChange={(e) => setIsMonitored(e.target.checked)}
              style={{ marginRight: '10px' }}
            />
            Set as monitored map
          </label>
          <button type="submit" style={{ padding: '10px 20px', margin: '20px 0', borderRadius: '5px', backgroundColor: '#4CAF50', color: '#fff', border: 'none', cursor: 'pointer' }}>
            {selectedMap ? 'Update Map' : 'Upload Map'}
          </button>
        </form>
      </div>
    </div>
  );
}

export default MapManagementPage;
